// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

// Set up you contract to convert DAI to USD or ETH to USD
contract LendingAndBorrowing is Ownable {
    AggregatorV3Interface priceFeed;
    address[] public tokensForLending;
    address[] public tokensForBorrowing;

    address[] public lenders;
    address[] public borrowers;

    mapping(address => mapping(address => uint256)) public tokensLentAmount;
    mapping(address => mapping(address => uint256)) public tokensBorrowedAmount;

    mapping(uint256 => mapping(address => address)) public tokensLent;

    mapping(address => address) public tokenToPriceFeed;

    struct Token {
        uint256 LTV;
        string APY;
        string rate;
    }
    IERC20 public larToken;
    uint256 public noOfTokensLent = 0;

    constructor(address _token) {
        larToken = IERC20(_token);
    }

    function addTokensForLending(address tokenAddress) public onlyOwner {
        if (!tokenIsAlreadyThere(tokenAddress, tokensForLending)) {
            tokensForLending.push(tokenAddress);
        }
    }

    function addTokensForBorrowing(address tokenAddress) public onlyOwner {
        if (!tokenIsAlreadyThere(tokenAddress, tokensForBorrowing)) {
            tokensForBorrowing.push(tokenAddress);
        }
    }

    function addTokenToPriceFeedMapping(address tokenAddress, address tokenToUsdPriceFeed) public onlyOwner {
        tokenToPriceFeed[tokenAddress] = tokenToUsdPriceFeed;
    }

    function getLendersLength() public view returns(uint){
        return lenders.length;
    }

    function lend(address tokenAddress) public payable{
         uint amount = msg.value;

        require(
            tokenIsAlreadyThere(tokenAddress, tokensForLending),
            "Token is not supported"
        );


        require(amount > 0, "The amount to supply should be greater than 0");

        IERC20 token = IERC20(tokenAddress);

        require(
            token.balanceOf(msg.sender) >= amount,
            "You have insufficient token to supply that amount"
        );

        token.transferFrom(msg.sender, address(this), amount);

        (bool userPresent, int256 userIndex) = isUserPresentIn(
            msg.sender,
            lenders
        );

        if (userPresent) {
            updateUserTokensLent(tokenAddress, amount, userIndex);
        } else {
            lenders.push(msg.sender);
            tokensLentAmount[tokenAddress][msg.sender] = amount;
            tokensLent[noOfTokensLent++][msg.sender] = tokenAddress;
        }

        rewardUserToken(msg.sender, tokenAddress, amount);
    }


    function tokenIsAlreadyThere(address tokenAddress, address[] memory tokenArray)
        private
        pure
        returns (bool)
    {
        for (uint256 i = 0; i < tokenArray.length; i++) {
            address currentTokenAddress = tokenArray[i];
            if (currentTokenAddress == tokenAddress) {
                return true;
            }
        }
        return false;
    }

     function rewardUserToken(address user, address tokenAddress, uint amount) internal onlyOwner{
         // Send some tokens to the user equivalent to the token amount lent.
         require(amount > 0, "Amount should be greater than 0");

         uint amountIndollars = getAmountInDollars(amount, tokenAddress);
         larToken.transfer(user, amountIndollars);

     }

     function getAmountInDollars(uint amount, address tokenAddress) public returns(uint){

         (uint dollarPerToken, uint decimals) = oneTokenEqualsHowManyDollars(tokenAddress);
         uint totalAmountInDollars = (amount * dollarPerToken) / decimals;
         return totalAmountInDollars;
     }

    function oneTokenEqualsHowManyDollars(address tokenAddress)
        internal
        returns (uint256, uint256)
    {
        address tokenToUsd = tokenToPriceFeed[tokenAddress];
        priceFeed = AggregatorV3Interface(tokenToUsd);

        (, int256 price, , , ) = priceFeed.latestRoundData();

        uint256 decimals = priceFeed.decimals();

        return (uint256(price), decimals);
    }


    function updateUserTokensLent(
        address tokenAddress,
        uint256 amount,
        int256 userIndex
    ) internal {
        address currentUser = lenders[uint(userIndex)];

        bool tokenLendedAlready = hasLentToken(currentUser, tokenAddress);

        if (tokenLendedAlready) {
            tokensLentAmount[tokenAddress][currentUser] =
                tokensLentAmount[tokenAddress][currentUser] +
                amount;
        } else {
            tokensLent[noOfTokensLent++][currentUser] = tokenAddress;
            tokensLentAmount[tokenAddress][currentUser] = amount;
        }
    }

    function hasLentToken(address currentUser, address tokenAddress) private view returns(bool) {
        for (uint256 i = 0; i < noOfTokensLent; i++) {
            address tokenAddressFound = tokensLent[i][currentUser];
            if (tokenAddressFound == tokenAddress) {
                return true;
            }
        }

        return false;
    }


    function isUserPresentIn(address userAddress, address[] memory users)
        private
        pure
        returns (bool, int256)
    {
        for (uint256 i = 0; i < users.length; i++) {
            address currentUserAddress = users[i];
            if (currentUserAddress == userAddress) {
                return (true, int256(i));
            }
        }
        return (false, -1);
    }

}
